import React from 'react';
import './App.css';
import Sidebar from "./Sidebar";
import Chat from "./Chat";



function App() {
  return (
    <div className="app">
      <div className="app-body">
        <Router>
          <Switch>

            <Route path="/app">
              <Sidebar />
              <Chat />
            </Route>

            <Route path="/">
              <h1>Home Screen</h1>
            </Route>



          </Switch>          
        </Router>        
      </div>
    </div>
  );
}

export default App;
